create table dw_open_access_log
(
    id                     int auto_increment comment '自增ID'
        primary key,
    data_access_app_id     int          null comment '接入应用的id',
    seq_no                 bigint       null comment '请求流水',
    data_asset_api_id      int          null comment '数据资产apiId',
    version                bigint       null comment '版本',
    result_code            int          null comment '返回码',
    result_row             int          null comment '返回数据记录数',
    elapsed                int          null comment '处理时间',
    ip                     varchar(20)  null comment '调用IP',
    create_time            datetime     null comment '创建时间;',
    update_time            datetime     null comment '更新时间;',
    lessee_id              int          null comment '租户ID',
    result_description     text         null comment '错误描述',
    api_invoke_source_type int          null comment '1 外部调用 2 内部测试 3 定时任务 4 事件接收',
    data_asset_method      varchar(256) null comment '接口地址',
    data_access_name       varchar(64)  null comment '应用名称',
    data_asset_group       varchar(64)  null comment '接口分类',
    data_request_param     text         null comment '请求参数',
    data_response_param    text         null comment '响应数据',
    data_asset_name        varchar(128) null comment '接口名称',
    api_invoke_source      varchar(100) null comment '调用来源'
)
    comment '开放接口访问日志;1、外部系统调用api产生的访问日志';

create index idx_access_app_id_lessess_id
    on dw_open_access_log (data_access_app_id, lessee_id);

create index idx_create_time_apiid
    on dw_open_access_log (create_time, data_asset_api_id);

